import timedef __solution(n):	cnt = 0	prev_res = 0	curr_res = 1	while cnt != n:		temp = curr_res		curr_res += prev_res		prev_res = temp				cnt += 1		return curr_resdef solution(n, k):	cnt = 0	prev_res = 0	curr_res = 1	while cnt != n:		temp = curr_res		curr_res = (curr_res + prev_res) % 10**k		prev_res = temp						cnt += 1		return curr_resdef main():	with open('input.txt', 'r') as f:		row = f.readline().rstrip()		args = list(map(int, row.split(' ')))		n, k = args[0], args[1]# 		time_start = time.time()		res = solution(n, k)		# 		fib = solution(n)# 		time_end_fib = time.time()		# 		res = fib % 10**k		# 		comment below# 		time_end_mod = time.time()		# 		time_fib = time_end_fib - time_start# 		time_mod = time_end_mod - time_end_fib# 		print(f'time_fib: {time_fib}')# 		print(f'time_mod: {time_mod}')			with open('output.txt', 'w') as f:		f.write(str(res))if __name__ == '__main__':	main()